const { getInput } = require('../utils');

const input = getInput('day19.txt').split('\n\n');

let inputCommands = input[0].replaceAll("\"", "").split('\n');
let inputStrings = input[1].split('\n');

let commandsMap = new Map();

for (let line of inputCommands) {
  line = line.split(":");
  commandsMap.set(
    line[0],
    line[1].split(" ").filter((char) => char !== " " && char !== "")
  );
}

function buildRegex(arr) {
  if (arr[0] === "a" || arr[0] === "b") {
    return arr[0];
  }

  let regex = "(";
  for (let char of arr) {
    if (char === "|") {
      regex += char;
      continue;
    }
    regex += buildRegex(commandsMap.get(char));
  }
  regex += ")";
  return regex;
}

let re = new RegExp(`^${buildRegex(commandsMap.get("0"))}$`);

let matches = 0;
for (let line of inputStrings) {
  if (re.test(line)) {
    matches++;
  }
}

console.log(`Answer: ${matches}`);

